//index.js at client
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
//import {Route, Redirect} from 'react-router'
import { BrowserRouter as Router, Route } from "react-router-dom";


ReactDOM.render(
    <Router>
        <div>
            <Route exact path="/">
                <App />
            </Route>
            <Route path="/news">
                <NewsFeed />
            </Route>
        </div>
    </Router>
);

